(37, 5, 'Formulir Permohonan Layanan Pendaftaran e-Mail @bppt.go.id', 'PRIVATE', 0, '5-D5FKJDFE5LD92FDE457L', '[{\"type\":\"radio-group\",\"required\":true,\"inline\":false,\"name\":\"radio-group-1590170054075\",\"other\":false,\"label\":\"Jenis Akun Email\",\"values\":[{\"label\":\"Pegawai\",\"value\":\"Pegawai\",\"selected\":true},{\"label\":\"Unit Kerja\",\"value\":\"Unit Kerja\"},{\"label\":\"Kegiatan\",\"value\":\"Kegiatan\"}]},{\"type\":\"textarea\",\"required\":true,\"className\":\"form-control\",\"name\":\"textarea-1590170054094\",\"subtype\":\"textarea\",\"label\":\"Tujuan Pembuatan Akun\"},{\"type\":\"file\",\"required\":false,\"className\":\"form-control\",\"name\":\"file-1590170054100\",\"label\":\"Daftar nama yang diajukan (jika lebih dari 4 (empat) mohon dilampirkan dengan format (DOC/PDF/XLS) dan upload disini)\"},{\"type\":\"paragraph\",\"subtype\":\"p\",\"label\":\"ATURAN<br>1. Pemohon e-mail sebagai penanggung jawab<br>2. Pemohon e-mail adalah pegawai BPPT<br>3. Domain dari e-mail BPPT adalah @bppt.go.id<br>4. Nama akun sesuai dengan aturan yang ada di BPPT<br>5. Masa berlaku akun untuk unit kerja dan kegiatan berlaku selama 1 (satu) tahun semenjak permohonan diberikan<br>6. Setting dengan mail client (Thunderbird, Outlook, dll) dapat dilihat di Modul&nbsp;&nbsp; Pelatihan Zimbra BPPT di&nbsp; https://csirt.bppt.go.id/&nbsp; menu unduhan<br>7. Kapasitas storage yang disediakan untuk e-mail adalah 7.5 GB<br>8. Pengguna bertanggung jawab atas kerahasiaan nama pengguna (username) dan kata sandi (password)<br>9. Menerima sanksi apabila melanggar ketentuan yang ditetapkan Pengelola ataupun peraturan lain yang berlaku di BPPT<br>10. Jika ada pertanyaan, pemohon dapat menghubungi servicedesk di 021-75791260/021-75791262/021-75791275 ext 3213 (Serpong) / 021-3169095 (Thamrin)/ whattsapp 088211130048 atau email&nbsp; servicedesk@bppt.go.id dan http://servicedesk.bppt.go.id\"}]', NULL, NULL, '2020-04-28 12:21:22', '2020-05-23 00:54:41', '[\"119\",\"120\",\"133\",\"164\"]', 'SETAMA/PMI/BII/SFK.02.00.01'),
(38, 5, 'Formulir Permohonan Reset Password @bppt.go.id', 'PRIVATE', 0, '5-73B6DECJE938F79AB4G5', '[{\"type\":\"textarea\",\"required\":true,\"label\":\"Tujuan Reset Password\",\"className\":\"form-control\",\"name\":\"textarea-1591931493089\",\"subtype\":\"textarea\"},{\"type\":\"text\",\"subtype\":\"email\",\"required\":true,\"label\":\"Alamat email lain (contoh: gmail ymail, dll)\",\"className\":\"form-control\",\"name\":\"text-1591931493099\"},{\"type\":\"paragraph\",\"subtype\":\"p\",\"label\":\"ATURAN<br>1. Pemohon e-mail adalah pegawai BPPT<br>2. Pemohon reset password e-mail adalah pemilik akun email<br>3. Dalam situasi tertentu, reset password dapat diwakilkan oleh atau diketahui oleh pejabat struktural atasan pemohon.<br>4. Pengguna bertanggung jawab atas kerahasiaan nama pengguna (username) dan kata sandi (password)<br>5. Pengguna dapat mengganti password di https://intranet.bppt.go.id pilih menu Akun dan pilih menu Ganti Password<br>6. Reset password dapat dilakukan secara mandiri melalui https://intranet.bppt.go.id pilih menu Lupa Password dengan syarat sebelumnya telah menginput email alternatif di profile diri https://akun.bppt.go.id<br>7. Setting dengan mail client (Thunderbird, Outlook, dll) dapat dilihat di Modul Pelatihan Zimbra BPPT di&nbsp; https://csirt.bppt.go.id/&nbsp; menu unduhan<br>8. Menerima sanksi apabila melanggar ketentuan yang ditetapkan Pengelola ataupun peraturan lain yang berlaku di BPPT<br>9. Jika ada pertanyaan, pemohon dapat menghubungi servicedesk di 021-75791260/021-75791262/021-75791275 ext 3213 (Serpong) / 021-3169095 (Thamrin)/ whattsapp 088211130048 atau email&nbsp; servicedesk@bppt.go.id dan http://servicedesk.bppt.go.id\"}]', NULL, NULL, '2020-04-28 12:27:34', '2020-08-26 15:59:19', '[\"13\",\"14\",\"114\",\"119\",\"120\",\"133\"]', 'SETAMA/PMI/BII/SFK.02.00.02'),
(39, 5, 'Formulir Pendaftaran Milis @bppt.go.id', 'PRIVATE', 0, '5-JFAFA43BB47HHE51C76J', '[{\"type\":\"radio-group\",\"required\":true,\"inline\":false,\"name\":\"radio-group-1590171459733\",\"other\":false,\"label\":\"Jenis Milis Yang Diajukan\",\"values\":[{\"label\":\"Unit Kerja\",\"value\":\"Unit Kerja\",\"selected\":true},{\"label\":\"Kegiatan\",\"value\":\"Kegiatan\"}]},{\"type\":\"text\",\"required\":true,\"className\":\"form-control\",\"name\":\"text-1590171459746\",\"subtype\":\"text\",\"label\":\"Nama Miils Yang Diajukan (Contoh : milis-....................................@bppt.go.id)\"},{\"type\":\"textarea\",\"required\":true,\"className\":\"form-control\",\"name\":\"textarea-1590171459751\",\"subtype\":\"textarea\",\"label\":\"Tujuan Pembuatan Milis\"},{\"type\":\"textarea\",\"required\":true,\"className\":\"form-control\",\"name\":\"textarea-1588052294523\",\"subtype\":\"textarea\",\"label\":\"Daftar Admin Milis yang Diajukan (Nama, Email)\"},{\"type\":\"file\",\"required\":true,\"className\":\"form-control\",\"name\":\"file-1590171459757\",\"label\":\"Daftar anggota milis yang diajukan harap dilampirkan dalam format .doc / .xls\"},{\"type\":\"paragraph\",\"subtype\":\"p\",\"label\":\"ATURAN<br>1. Pemohon adalah salah satu dari admin milis.<br>2. Pemohon memilih nama milis yang baik dan sopan<br>3. Nama milis adalah milis-namamilis@bppt.go.id.<br>4. Admin dapat membuka halaman admin di http://milis.bppt.go.id/mailman/admin/milis-namamilis/<br>5. Fasilitas attachment 4 MB per hari<br>6. Admin bertanggung jawab atas kerasiaan password page admin dan kelangsungan&nbsp;&nbsp; milis.<br>7. Menerima sanksi apabila melanggar ketentuan yang ditetapkan Pengelola ataupun peraturan lain yang berlaku di BPPT<br>8. Jika ada pertanyaan, pemohon dapat menghubungi servicedesk di 021-75791260/021-75791262/021-75791275 ext 3213 (Serpong) / 021-3169095 (Thamrin)/ whattsapp 088211130048 atau email&nbsp; servicedesk@bppt.go.id dan http://servicedesk.bppt.go.id\"}]', NULL,