(46, 5, 'Formulir Permohonan Layanan SaaS Cloud', 'PRIVATE', 0, '5-3B2KJ2MAFJFFH3DB5975', '[{\"type\":\"textarea\",\"required\":true,\"className\":\"form-control\",\"name\":\"textarea-1590171942382\",\"subtype\":\"textarea\",\"label\":\"Tujuan Pembuatan\"},{\"type\":\"number\",\"required\":true,\"description\":\"Isi Dalam Bulan\",\"className\":\"form-control\",\"name\":\"number-1592191787036\",\"value\":\"1\",\"min\":1,\"max\":12,\"step\":1,\"label\":\"Jangka Waktu Penggunaan (Temporer)\"},{\"type\":\"paragraph\",\"subtype\":\"p\",\"label\":\"ATURAN<br>1. Pemohon adalah penanggungjawab sekaligus Admin dari layanan SaaS yang diminta.<br>2. Admin bertanggung jawab atas kerahasiaan password layanan.<br>3. Pengelola layanan tidak bertanggung jawab terhadap isi/ konten yang ada dalam layanan.<br>4. File server menggunakan berkas.bppt.go.id dengan kapasitas 5 GB<br>5. Menerima sanksi apabila melanggar ketentuan yang ditetapkan Pengelola ataupun peraturan lain yang berlaku di BPPT.<br>6. Jika ada pertanyaan, pemohon dapat menghubungi servicedesk di 021-75791260/021-75791262/021-75791275 ext 3213 (Serpong) / 021-3169095 (Thamrin)/ whattsapp 088211130048 atau email&nbsp; servicedesk@bppt.go.id dan http://servicedesk.bppt.go.id<br><br><br><br><br><br><br><br>\"}]', NULL, NULL, '2020-04-28 14:04:26', '2020-06-15 11:15:41', '[\"113\",\"114\"]', 'SETAMA/PMI/BII/SFK.02.00.10'),
