(48, 5, 'Formulir Permohonan Pengadaan IP BPPT', 'PRIVATE', 0, '5-7FH1C9AL61LDHJ446MMM', '[{\"type\":\"textarea\",\"required\":true,\"className\":\"form-control\",\"name\":\"textarea-1590177536958\",\"subtype\":\"textarea\",\"label\":\"Tujuan Penggunaan IP Publik\"},{\"type\":\"text\",\"required\":false,\"className\":\"form-control\",\"name\":\"text-1590177536965\",\"subtype\":\"text\",\"label\":\"IP Adress Lokal (Kosongkan Jika Anda Juga Mengajukan Formulir Cloud Computing)\"},{\"type\":\"text\",\"required\":false,\"className\":\"form-control\",\"name\":\"text-1588058964451\",\"subtype\":\"text\",\"label\":\"Port Yang Digunakan\"},{\"type\":\"paragraph\",\"subtype\":\"p\",\"label\":\"ATURAN:<br>1. Pemohon adalah admin dari pengelola IP yang diminta<br>2. Masa berlaku IP publik 1 (satu) tahun semenjak permohonan diberikan<br>3. Menerima sanksi apabila melanggar ketentuan yang ditetapkan Pengelola ataupun peraturan lain yang berlaku di BPPT.<br>4. Jika ada pertanyaan, pemohon dapat menghubungi servicedesk di 021-75791260/021-75791262/021-75791275 ext 3213 (Serpong) / 021-3169095 (Thamrin)/ whattsapp 088211130048 atau email<br>servicedesk@bppt.go.id dan http://servicedesk.bppt.go.id\"}]', NULL, NULL, '2020-04-28 14:32:04', '2020-06-15 11:09:11', '[\"114\",\"117\",\"133\"]', 'SETAMA/PMI/BII/SFK.02.00.07'),
(49, 5, 'Formulir Permohonan Layanan Nama Subdomain BPPT', 'PRIVATE', 0, '5-2E8LBJ72DJ36J81EH36D', '[{\"type\":\"textarea\",\"required\":true,\"className\":\"form-control\",\"name\":\"textarea-1592193655239\",\"subtype\":\"textarea\",\"label\":\"Tujuan Penggunaan Subdomain\"},{\"type\":\"text\",\"required\":false,\"className\":\"form-control\",\"name\":\"text-1592193655247\",\"subtype\":\"text\",\"label\":\"IP Adress Lokal\"},{\"type\":\"text\",\"required\":false,\"className\":\"form-control\",\"name\":\"text-1588059306659\",\"subtype\":\"text\",\"label\":\"Port yang Digunakan\"},{\"type\":\"text\",\"required\":true,\"className\":\"form-control\",\"name\":\"text-1588059321032\",\"subtype\":\"text\",\"label\":\"Nama Subdomain Yang Diusulkan\"},{\"type\":\"paragraph\",\"subtype\":\"p\",\"label\":\"ATURAN:<br>1. Pemohon adalah admin dari pengelola IP dan sub-domain yang diminta.<br>2. Pemohon memilih nama sob-domain yang baik dan sopan sesuai dengan ketentuan di BPPT<br>3. Nama sub-domain harus memiliki hubungan dengan tujuan sub-domain tersebut<br>4. Jika pemohon membutuhkan IP Publik silakan mengajukan juga formulir pendaftaran layanan IP Publik<br>5. Masa berlaku Subdomain 1 (satu) tahun semenjak permohonan diberikan<br>6. Admin bertanggung jawab atas kerahasiaan dan keamanan dalam pengelolaan sub-domain tersebut.<br>7. Menerima sanksi apabila melanggar ketentuan yang ditetapkan Pengelola ataupun peraturan lain yang berlaku di BPPT.<br>8. Jika ada pertanyaan, pemohon dapat menghubungi servicedesk di 021-75791260/021-75791262/021-75791275 ext 3213 (Serpong) / 021-3169095 (Thamrin)/ whattsapp 088211130048 atau email&nbsp; servicedesk@bppt.go.id dan http://servicedesk.bppt.go.id\"}]', NULL, NULL, '2020-04-28 14:37:59', '2020-06-15 11:05:37', '[\"114\",\"117\"]', 'SETAMA/PMI/BII/SFK.02.00.04'),
(50, 5, 'Formulir Permohona Co-Location', 'PRIVATE', 0, '5-HD58FD9HK583F698A64H', '[{\"type\":\"textarea\",\"required\":true,\"className\":\"form-control\",\"name\":\"textarea-1592188572519\",\"subtype\":\"textarea\",\"label\":\"Tujuan Penitipan Server\"},{\"type\":\"textarea\",\"required\":true,\"className\":\"form-control\",\"name\":\"textarea-1588059610293\",\"subtype\":\"textarea\",\"label\":\"Aplikasi Yang Di Install\"},{\"type\":\"text\",\"required\":true,\"className\":\"form-control\",\"name\":\"text-1592188572539\",\"subtype\":\"text\",\"label\":\"Jenis Perangkat\"},{\"type\":\"textarea\",\"required\":true,\"className\":\"form-control\",\"name\":\"textarea-1588059670157\",\"subtype\":\"textarea\",\"label\":\"Spesifikasi Perangkat (Merk, Processor, Memory, Hardisk, dsb)\"},{\"type\":\"paragraph\",\"subtype\":\"p\",\"label\":\"ATURAN<br>1. Pemohon colocation sebagai penanggung jawab/admin server colocation<br>2. Pemohon adalah staf yang bekerja/beraktifitas di lingkungan BPPT<br>3. Jangka waktu penitipan selama 1 tahun<br>4. Menerima sanksi apabila melanggar ketentuan yang ditetapkan Pengelola ataupun peraturan lain yang berlaku di BPPT. <br>5. Admin bertanggung jawab atas kerahasiaan dan keamanan dalam pengelolaan server colocation tersebut.<br>6. Jika ada pertanyaan, pemohon dapat menghubungi servicedesk di 021-75791260/021-75791262/021-75791275 ext 3213 (Serpong) / 021-3169095 (Thamrin)/ whattsapp 088211130048 atau email&nbsp; servicedesk@bppt.go.id dan http://servicedesk.bppt.go.id\"}]', NULL, NULL, '2020-04-28 14:43:43', '2020-06-15 11:07:16', '[\"133\",\"164\"]', 'SETAMA/PMI/BII/SFK.02.00.11'),
